Info:
----------
Graceland is an American police drama television series on the USA Network created by Jeff Eastin. It premiered on June 6, 2013.


Premise:
----------
A group of undercover agents from various law enforcement agencies in the United States, including the DEA, the FBI, and the ICE, live together in a confiscated Southern California beach house known as &quot;Graceland&quot;. Rookie FBI agent Mike Warren is assigned to the house fresh out of Quantico training.



